webpackJsonp([35523964790954],{6652:function(e,t){e.exports={data:{post:{html:'<p>One thing I forgot to mention about states visited (other than that even <a title="Visited States by Heiko Hebig | hebig.com" href="http://www.hebig.com/archives/001933.shtml">Germans</a>  are jumping in) is that I\'ve noticed that most folks have not been to Minnesota. Figures, it\'s not really a state that one travels <i>through</i> (unless one is taking a road trip to, say, Winnipeg). And even if one is flying <a title="Northwest Airlines, the state airline of the Midwest" href="http://www.nwa.com/">Aeroflot-USA</a>, nowadays you\'re more likely to change planes at Detroit or Memphis than at their home base of MSP. Or are people letting those 50 below temperatures scare them off? Wimps.</p>',fields:{title:"More States",date:"02 Feb 2004",url:"https://papascott.de/2004-02-02-more-states/"}}},pathContext:{slug:"/2004-02-02-more-states/",prev:{fields:{title:"In Minnesota it was so cold they closed the Ice Palace",date:"02 Feb 2004",slug:"/2004-02-02-in-minnesota-it-was-so-cold-they-closed-the-ice-palace/"}},next:{fields:{title:"How to upgrade Mandrake easily with only one reboot",date:"03 Feb 2004",slug:"/2004-02-03-how-to-upgrade-mandrake-easily-with-only-one-reboot/"}}}}}});
